from django.test import TestCase
from rest_framework import status
from rest_framework.test import APIRequestFactory, RequestsClient, APIClient
from .models import *
import json
# Create your tests here.

baseURL = 'http://127.0.0.1:8000/market/'


class ProductTestCase(TestCase):

    def setUp(self):
        self.client = APIClient(enforce_csrf_checks=True)
        user = User(email='huyn27316@gmail.com', phone_number='0937461321', is_business=True, email_verified=True, phone_verified=True)
        user.set_password('0937461321Huy@')
        user.save()
        self.client.force_authenticate(user=user)

    def test_get_list_categories(self):
        response = self.client.get(f'{baseURL}category/')
        print(response.data)
        self.assertEqual(response.status_code, 200)

    def test_post_product(self):
        Category.objects.create(name='Smartphone')
        Category.objects.create(name='Laptop')
        Category.objects.create(name='Book')
        Category.objects.create(name='Clothes')
        Category.objects.create(name='Sneaker')
        cat_response = self.client.get(f'{baseURL}category/')
        print(cat_response.data)
        response = self.client.post(f'{baseURL}products/', data=json.dumps({
          "name": "Sneaker Yankee",
          "is_available": True,
          "description": "Giày sneaker Yankee thời trang phù hợp cho giới trẻ với đế cao",
          "categories": [
            10
          ],
          "image": "data:image/jpeg;base64,"
        }), content_type='application/json')
        print(response.data)
        self.assertEqual(response.status_code, 201)

    def test_list_product(self):
        Category.objects.create(name='Smartphone')
        Category.objects.create(name='Laptop')
        Category.objects.create(name='Book')
        Category.objects.create(name='Clothes')
        cat_1 = Category.objects.create(name='Sneaker')
        user = User.objects.create(email='huyn27318@gmail.com', phone_number='09367473577')
        user.set_password('0937461321Huy@')
        product = Product.objects.create(name='a', owner=user)
        product.categories.add(cat_1)

        response = self.client.get(f'{baseURL}products/')
        self.assertEqual(response.status_code, 200)

    def test_put_product(self):
        response = self.client.put(f'{baseURL}products/2/', data=json.dumps({
            "name": "Sneaker Yankee",
            "is_available": False,
            "description": "Giày sneaker Yankee thời trang phù hợp cho giới trẻ với đế cao",
            "categories": [
                10
            ],
            "image": "data:image/jpeg;base64,"
        }))
        self.assertEqual(response.status_code, 204)
